import React, { useState } from "react";
import { useNavigate } from 'react-router-dom'; // Import useNavigate from React Router
import cancel from '../components/images/cancel.jpg';
import black_x from '../components/images/black_x.jpg';
import apple from '../components/images/apple.png';
import google from '../components/images/google.png';

const Signin = () => {
  const navigate = useNavigate(); // Initialize navigate

  const [user, setUser] = useState({ username: "" }); // State for username

  // Define the list of registered usernames
  const registeredUsernames = [{user}]; // Replace with your registered usernames

  const handleChange = (e) => {
    const { name, value } = e.target;
    setUser({ ...user, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Entered username:", user.username);
    console.log("Registered usernames:", registeredUsernames);
    navigate('/signflow');
    // Check if the entered username exists in the list of registered usernames
    if (registeredUsernames.includes(user.username)) {
      // Store the username in sessionStorage
      sessionStorage.setItem("username", user.username);
      // Redirect to "/signflow" for password confirmation

    } else {
      // Display an error message if the username is not registered
      print("Username is not registered");
    }
  };

  return (
    // Your JSX code for the form
    <form onSubmit={handleSubmit} className="main_sign">
      <div className="sign-in">
        <a href="/public">
          <img className="cross" height="20px" width="20px" src={cancel} alt="img" />
        </a>
        <div className="nav_1">
          <div className="for-x">
            <div>
              <img
                height="60px"
                width="60px"
                className="x-mark"
                src={black_x}
                alt="x-mark"
              />
            </div>
          </div>
        </div>
        <div className="down-box">
          <div className="content">
            <h2>Sign In To X</h2>
            <div className="box_"><img height='30px' src={google} alt="google"/>Sign In With Google</div>
            <div className="box_"><img height='30px' src={apple} alt="apple"/> Sign In With Apple</div>
            <div className="lin_main">
              <div className="lin"></div><div className="text">or</div><div className="lin"></div>
            </div>
            <input
              className="input"
              type="text"
              name="username"
              onChange={handleChange}
              placeholder="Phone, email, or username"
            />
            <button type="submit" className="box_ nex">Next</button>
            <div className="box_">Forgot password?</div>
            <div className="text">Don't have an account? <a href="/create">Sign Up</a></div>
          </div>
          <div />
        </div>
      </div>
    </form>
  );
}

export default Signin;
